import React from 'react'


const multiply=(a,b)=>{

    return a* b   
}

let today = new Date.getMinute()
const z = Math.ceil(100*(Math.random()))
console.log("my name is zahid", multiply(6,7))
console.log(z)
console.log(today)

const Func = () => {
    return (
        <>
        <h1 contentEditable= "true">hlo how are you {multiply(6,10)}</h1>
        <h1 contentEditable= "true">hlo how are you {z}</h1>
            
        </>
    )
}

export default Func
